<script>
import Vue from 'vue';
export default {

  name: "ResultMap",
  data() {
    return {
      aliments1: {
        id: null,
        aliments: [],
      },
      aliments2: {
        id: null,
        aliments: [],
      }
    }
  },
  methods: {
    getAliments: function (event) {
      if(event.target.classList.contains('selected')){
        event.target.classList.remove('selected')
        if(event.target.id === this.aliments2.id){
          this.aliments2.id = null;
          this.aliments2.aliments = []
        }
        else{
          this.aliments1.aliments = this.aliments2.aliments
          this.aliments1.id = this.aliments2.id
          this.aliments2.id = null;
          this.aliments2.aliments = []
        }
        return;
      }

      event.target.classList.add('selected');
      const id = (event.target.getAttribute("id")).trim();
      if(this.aliments2.id !== null){
        document.getElementById(this.aliments1.id).classList.remove('selected')
        this.aliments1.aliments = this.aliments2.aliments
        this.aliments1.id = this.aliments2.id
        this.loadAliments(id,20,'aliments2')
      }
      else if (this.aliments1.id !== null && this.aliments2.id === null){
        this.loadAliments(id,20,'aliments2')
      }
      else{
        this.loadAliments(id,20,'aliments1')
      }

    },
    loadAliments: function(id,size,property) {
      const url =`http://localhost:9000/api/statistiques/MostConsumedByDepartment/${id}?size=${size}`;

      this[property].id = id
      return fetch(url)
        .then((response) => response.json())
        .then((data) => {
          this[property].aliments = data;

        });
    },
  }
}

</script>

